import React from "react";

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <div>
            <Navbar bg="primary" variant="dark" className="footer">
        <Container>

          <Nav className="footer">
            <table  width={500}><tr><td>
            <Navbar.Brand className="footer">Star Wars shop graduate work and test issue from Oleg Martynov</Navbar.Brand>
            </td><td>
            <Nav.Link href="https://github.com/hristinson/graduate_React">Github/hristinson</Nav.Link>
            </td>
            </tr>
            </table>
          </Nav>
        </Container>
      </Navbar>

    </div>
  );
}

export default Footer;
